import * as react from 'react';
import { Chip, Grid, Stack, Card, CardHeader, CardContent, Typography } from '@mui/material';

export default function Trends() {
  return (
    <Grid container sx={{ flex: 1, minHeight: 0, bgcolor: 'background.paper' }} direction="column">
      <Grid size={{ xs: 12 }}>
        <Typography>Trends</Typography>
      </Grid>
      <Grid size={{ xs: 12 }}>ToolBar</Grid>
      <Grid container size={{ xs: 12 }} sx={{ flex: 1, minHeight: 0 }}>
        <Grid size={{ xs: 12, md: 10 }}></Grid>
        <Grid size={{ xs: 12, md: 2 }}></Grid>
      </Grid>
    </Grid>
  );
}
